        <div>
            <div>
            <input
            value = {addItem.title}
            onChange = {e => setAddItem({...addItem, title: e.target.value })}
            type="text" 
            placeholder='Заметка' 
            />
            <button 
                // onClick ={addItem}
            >Создать заметку</button>
            </div>
            <div>

            </div>
        </div>
    )
}

